import React from "react";
import WithCard from "components/container/withCard";
import { fetchUsers } from "api/db-init";
import { Button } from "semantic-ui-react";

type Props = {
  env: string;
};

const Saved: React.FC = async (props: Props) => {
  const users = await fetchUsers(this.props.env);
  this.setState({ users });
  return (
    <div>
      {this.state.users ? (
        this.state.users.map(() => <WithCard />)
      ) : (
        <React.Fragment>
          <h1>There is no saved user</h1>
          <Button color="green">Go to Home</Button>
        </React.Fragment>
      )}
    </div>
  );
};

export default Saved;
